import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import RecipeReviewCard from './item1';
import RecipeReviewCard1 from './item2';
import RecipeReviewCard2 from './item2';

function AutoLayoutSizingExample() {
    return (
      <Container className='mt-5'>
        <Row>
          <Col><RecipeReviewCard1 /></Col>
          <Col><RecipeReviewCard1 /></Col>
          <Col><RecipeReviewCard2 /></Col>
        </Row>
        <Row className='mt-5'>
          <Col>1 of 3</Col>
          <Col>2 of 3</Col>
          <Col>3 of 3</Col>
        </Row>
      </Container>
    );
  }
  
  export default AutoLayoutSizingExample;
